        /// <summary>
        /// Invoked when the SelectedValue changed
        /// </summary>
        /// <param name="sender">ComboBox</param>
        /// <param name="e">Selected Value changed</param>
        private void ComboBoxAdv2_SelectedValueChanged(object sender, System.EventArgs e)
        {
            switch(comboBoxAdv1.SelectedIndex.ToString())
            {
                case "0":
                    MessageBoxAdv.CaptionFont = new Font(fontComboBox1.SelectedItem.ToString(), float.Parse(comboBoxAdv2.SelectedItem.ToString()));
                    break;
                case "1":
                    MessageBoxAdv.MessageFont = new Font(fontComboBox1.SelectedItem.ToString(), float.Parse(comboBoxAdv2.SelectedItem.ToString()));
                    break;
                case "2":
                    MessageBoxAdv.ButtonFont = new Font(fontComboBox1.SelectedItem.ToString(), float.Parse(comboBoxAdv2.SelectedItem.ToString()));
                    break;
                case "3":
                    MessageBoxAdv.DetailsFont = new Font(fontComboBox1.SelectedItem.ToString(), float.Parse(comboBoxAdv2.SelectedItem.ToString()));
                    break;

            }    
        }

